import React, { useState } from 'react'
import { Routes, Route, NavLink as Link } from "react-router-dom";

function SideBar() {
  const [active, setActive] = useState("")


  const handleActive = (e) => {
    console.log(e.target.id);
    setActive(e.target.id)
  }
  return (
    <div className='main_sidebar'>
      <div className='dash_icon'>
        <span className='home_icon'>
          <i class="fa-solid fa-house"></i>
        </span>
        <h3>Dashboard</h3>
      </div>
      <div className='dash_list'>
        <ul>
          <Link to="/" id="dashboard" >
            <div onClick={(e) => { handleActive(e) }} id="dashboard" className={
              active === "dashboard"
                ? "list_active"
                : "side_list"
            }> <span><i class="fa-solid fa-gauge"></i></span> Dashboard
            </div>
          </Link>
          <Link to="/product" id='product'>
            <div
              id='product'
              onClick={(e) => { handleActive(e) }}
              className={
                active === "product"
                  ? "list_active"
                  : "side_list"
              }><span><i class="fa-solid fa-square-poll-vertical"></i></span> Products <span><i class="fa-solid fa-chevron-right"></i></span>
            </div>

          </Link>
          <Link to="/customers" id='customers'>
            <div id='customers' onClick={(e) => { handleActive(e) }}
              className={
                active === "customers"
                  ? "list_active"
                  : "side_list"
              }
            > <span><i class="fa-solid fa-user"></i></span> Customers <span><i class="fa-solid fa-chevron-right"></i></span>
            </div>

          </Link>
          <Link to="/income" id='income'>
            <div id='income' onClick={(e) => { handleActive(e) }}
              className={
                active === "income"
                  ? "list_active"
                  : "side_list"
              }
            ><span><i class="fa-solid fa-wallet"></i></span> Income <span><i class="fa-solid fa-chevron-right"></i></span>
            </div>

          </Link>
          <Link to="/promote" id='promote'>
            <div onClick={(e) => { handleActive(e) }}
              className={
                active === "promote"
                  ? "list_active"
                  : "side_list"
              }
            > <span><i class="fa-solid fa-snowflake"></i></span>Promote <span><i class="fa-solid fa-chevron-right"></i></span>
            </div>

          </Link>

          <Link to="/help" id='help'>
            <div onClick={(e) => { handleActive(e) }}
              className={
                active === "help"
                  ? "list_active"
                  : "side_list"
              }
            ><span><i class="fa-regular fa-message"></i></span> Help <span><i class="fa-solid fa-chevron-right"></i></span>
            </div>
          </Link>



        </ul>
      </div>
    </div>
  )
}

export default SideBar
